using System;
using System.Text;
using NUnit.Framework;
using System.Linq;
using System.Collections.Generic;
using Common;

namespace RemoveAllAdjacentDuplicatesInStringII
{
    [TestFixture]
    public class SolutionTest
    {
        private static readonly object[] testCases =
        {
            new object[] {"abcd", 2, "abcd"},
            new object[] {"deeedbbcccbdaa", 3, "aa"},
            new object[] {"pbbcggttciiippooaais", 2, "ps"},
            new object[] {"aa", 3, "aa"},
            new object[] {"aaa", 3, ""},
            new object[] {"aaaa", 3, "a"},
            new object[] {"aaaaa", 3, "aa"},
            new object[] {"aaaaaa", 3, ""},
            new object[] {"aaaaaaa", 3, "a"},
            new object[] {"", 2, ""},
        };

        [Test]
        [TestCaseSource("testCases")]
        public void Test_Generic(string s, int k, string expected)
        {
            var sol = new Solution();
            var res = sol.RemoveDuplicates(s, k);

            Assert.AreEqual(res, expected);
        }
    }
}